import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import Paper from "@material-ui/core/Paper";

const TestLog = (props) => {
  const entry = props.entry;
  const entries = props.entries;
  const deleteThisEntry = props.deleteThisEntry;


  const useStyles = makeStyles({
    table: {
      minWidth: 650,
    },
  });

  const classes = useStyles();

  return (
    <TableContainer component={Paper}>
      <Table className={classes.table} size="small" aria-label="a dense table">
        <TableHead>
          <TableRow>
            <TableCell>Time</TableCell>
            <TableCell align="right">Vehicle Number</TableCell>
            <TableCell align="right">Attendee Count</TableCell>
            <TableCell align="right">Entered By</TableCell>
            <TableCell align="right">Actions</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {entries.map((entry) => (
            <TableRow key={entry.time}>
              <TableCell component="th" scope="entry">
                {entry.time}
              </TableCell>
              <TableCell align="right">{entry.vehicle_number}</TableCell>
              <TableCell align="right">{entry.attendee_count}</TableCell>
              <TableCell align="right">{entry.user.first_name} {entry.user.last_name}</TableCell>
              <TableCell align="right">Delete</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
};

export default TestLog;
